        <div>
            <h1>Apartments for Cooperation {cooperationId}</h1>
            <p>List of apartments will be displayed here.</p>
            {/* Можеш да добавиш съдържание или функционалност за апартаментите тук */}
        </div>
    );
};

export default AllApartments;
